import React, { Component } from 'react'
import './App.css'

class App extends Component {
    clicked(e) {
        console.log(e.target);
    }
    
    render() {
        return (
            <div id='game'>
                <div id='head'>
                Tic Tac Toe
                </div> 
                <div id='board' onClick={(e)=>clicked()}>
                    <div className='square'></div>
                    <div className='square'></div>
                    <div className='square'></div>
                    <div className='square'></div>
                    <div className='square'></div>
                    <div className='square'></div>
                    <div className='square'></div>
                    <div className='square'></div>
                    <div className='square'></div>
                </div>
            </div>
        )
    }
}

export default App;
